import React from 'react';
import Card from "./Card";
import {robots} from "./robots";

const CardList = ({robots}) => {
    const cardComponent = robots.map((user,i) => {
        return <Card key={i}
                     id={robots[i].id}
                     name={robots[i].username}
                     email={robots[i].email}
                />
    })
    return (
        <div>
            {cardComponent}
        </div>
    )
}

export default CardList;
